import React from 'react';

const Cam = () => {
    return (
        <div>
          <h2>Webcam Feeds</h2>
          <div className="row">
            <div className="col-md-6">
              <h3>Camera 1</h3>
              <img src="http://localhost:5000/image_feed1" alt="Camera 1" />
            </div>
            <div className="col-md-6">
              <h3>Camera 2</h3>
              <img src="http://localhost:5000/image_feed2" alt="Camera 2" />
            </div>
          </div>
        </div>
      );
};

export default Cam;
